import React from 'react';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Signup from './pages/signup';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route element={<Signup />}/>
          <Route element={<Signin />}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
